def collision(xp,yp,wall):
    for i in wall:
        (xm,ym,w,h)=i
        if (xm<xp-k/3<xm+w or xm<xp+k/3<xm+w or xm<xp<xm+w)  and (ym<yp-k/3<ym+h or ym<yp+k/3<ym+h or ym<yp<ym+h):
            return False
    return True


def moy(xp,yp):
    return (round(xp/k-1/2),round(yp/k-1/2))

def voisins(i,j):
    return [((i-1)%19,j),((i+1)%19,j),(i,j-1),(i,j+1)]


def astar(x0,y0,x2,y2,m):
    douv={}
    dfer={}
    nc=(x0,y0)
    if (x0,y0)==(x2,y2):
        return (x0,y0)
    
    while (x2,y2)!=nc:
        x1,y1=nc
        for j in voisins(x1,y1):
            x3,y3=j
            if m[y3][x3]!=0 and (x3,y3) not in dfer:
                d=abs(x3-x2)+abs(y3-y2)+abs(x1-x3)+abs(y1-y3)
                if (x3,y3) in douv:
                    distmin, parent=douv[(x3,y3)]
                    
                    if d<distmin:
                        douv[(x3,y3)]=(d,nc)
                else:
                    douv[(x3,y3)]=(d,nc)
            
            elif (x3,y3) in dfer:
                d=abs(x3-x2)+abs(y3-y2)+abs(x1-x3)+abs(y1-y3)
                if (x3,y3) in douv:
                    distmin, parent=dfer[(x3,y3)]
                    
                    if d<distmin:
                        douv[(x3,y3)]=(d,nc)
                
                    
        M=float('inf')
        pere=''
        if douv=={}:
            print((x0,y0),x2,y2)
        for i in douv:
            dist,parent=douv[i]
            if dist<M:
                M=dist
                nc=i
        dfer[nc]=douv[nc]
        del douv[nc]
    
    l=[]
    while nc!=(x0,y0):
        l.append(nc)
        nc=dfer[nc][1]
    return(l[-1])


def prochaine_intersection(px,py,direction,matrice):
    if direction=='down':
        while matrice[py][px]==1:
            py+=1
    elif direction=='up':
        while matrice[py][px]==1:
            py-=1
    elif direction=='right':
        while matrice[py][px]==1:
            px=(px+1)%19
    elif direction=='left':
        while matrice[py][px]==1:
            px=(px-1)%19
    return (px,py)

def derniere_intersection(px,py,direction,matrice,graphe):
    if matrice[py][px]>1:
        l=[i[:2] for i in graphe[(px,py)]]
        return l[random.randint(0,len(l)-1)]
    if direction=='down':
        while matrice[py][px]==1:
            py-=1
    elif direction=='up':
        while matrice[py][px]==1:
            py+=1
    elif direction=='right':
        while matrice[py][px]==1:
            px=(px-1)%19
    elif direction=='left':
        while matrice[py][px]==1:
            px=(px+1)%19
    return (px,py)


def couper_route(graphe,px,py,direction,matrice,compteur):
    suiv=prochaine_intersection(px,py,direction,matrice)
    dern=derniere_intersection(px,py,direction,matrice,graphe)
    while len(graphe[suiv])==2:
        l=[i[:2] for i in graphe[suiv]]
        suiv,dern=(l[:l.index(dern)]+l[l.index(dern)+1:])[0],suiv
    
    return (prochaine_intersection(px,py,direction,matrice),compteur)

def objectif_bleu(px,py,rx,ry,direction,matrice):
    ox,oy=prochaine_intersection(px,py,direction,matrice)
    a,b=2*ox-rx,2*oy-ry
    cd = 2
    cl = 1
    mem=0
    if a>19: a=19
    elif a<0: a=0
    if b>21: b=21
    elif b<0: b=1
        
    while not (0<=a<19 and 0<=b<21) or mat[b][a]==0:
        if cd==0:
            a+=1
        elif cd==1:
            b+=1
        elif cd==2:
            a-=1
        elif cd==3:
            b-=1
        mem+=1
        
        if mem==cl:
            mem=0
            cd=(cd+1)%4
            if cd%2==0:
                cl+=1
    return a,b

