def generation_labyrinthe(p):
    m=[[0]*19 for i in range(21) ]
    for i in range(1,20):
        for j in range(1,18):
            if random.random()>p:
                n=randint(2,10)
                m[i][j]=n
    if m[1][17]==0:m[1][17]=8
    if m[1][1]==0:m[1][1]=7
    if m[19][1]==0:m[19][1]=6
    if m[19][17]==0:m[19][17]=9
        

    liste=[]
    for i in range(1,20):
        for j in range(1,18):
            if m[i][j]!=0 :
                liste.append((i,j,m[i][j]))
                m[i][j]=0
    for elt in liste :
        decoupage(m,elt)
    return m

def decoupage(m,elt):
    n=elt[2]
    N=False
    Y=True
    l=[N,N,N,N] #dans l'ordre nord,ouest,sud,est (parcours trigo)
    if n==2: l=[N,Y,Y,Y]
    if n==3: l=[Y,N,Y,Y]
    if n==4: l=[Y,Y,N,Y]
    if n==5: l=[Y,Y,Y,N]
    if n==6: l=[Y,N,N,Y]
    if n==7: l=[N,N,Y,Y]
    if n==8: l=[N,Y,Y,N]
    if n==9: l=[Y,Y,N,N]
    if n==10: l=[Y,Y,Y,Y]
    m[elt[0]][elt[1]]=1
    if l[0]:
        i,j=elt[0]-1,elt[1]
        while m[i][j]==0 and i>0 :
            m[i][j]=1
            i+=-1
    if l[1]:
        i,j=elt[0],elt[1]-1
        while m[i][j]==0 and j>0 :
            m[i][j]=1
            j+=-1
    if l[2]:
        i,j=elt[0]+1,elt[1]
        while m[i][j]==0 and i<20 :
            m[i][j]=1
            i+=1
    if l[3]:
        i,j=elt[0],elt[1]+1
        while m[i][j]==0 and j<18 :
            m[i][j]=1
            j+=1

def rigole(m):
    i=1 #haut g->d
    besoin=False
    for j in range(1,18):
        if m[i][j]==0 and besoin :
            m[i][j]=1
            if m[i+1][j]==1:
                besoin=False
        elif m[i][j]==1 :
            besoin=not(besoin)
    j=17 #est haut->bas
    besoin=False
    for i in range(1,20):
        if m[i][j]==0 and besoin :
            m[i][j]=1
            if m[i][j-1]==1:
                besoin=False
        elif m[i][j]==1 :
            besoin=not(besoin)
    i=19 #bas d->g
    besoin=False
    for k in range(1,18):
        j=18-k
        if m[i][j]==0 and besoin :
            m[i][j]=1
            if m[i-1][j]==1:
                besoin=False
        elif m[i][j]==1 :
            besoin=not(besoin)
    j=1 #ouest bas->haut
    besoin=False
    for k in range(1,20):
        i=20-k
        if m[i][j]==0 and besoin :
            m[i][j]=1
            if m[i][j+1]==1:
                besoin=False
        elif m[i][j]==1 :
            besoin=not(besoin)

def amincir(m):
    liste=[]
    for i in range (2,19): #commence par le centre
        for j in range(2,17):
            if m[i][j-1]==1 and m[i][j+1]==1 and m[i-1][j]==1 and m[i+1][j]==1 and m[i-1][j-1]==1 and m[i-1][j+1]==1 and m[i+1][j-1]==1 and m[i+1][j+1]==1 :
                liste.append((i,j))
    for case in liste:
        i,j=case
        m[i][j]=0


def parfaire(m):
    l=len(m)
    c=len(m[0])
    for i in range(1,l-1):
        for j in range(1,c-1):
            n=reconnaitre(m,i,j)
            m[i][j]=n

def reconnaitre(m,i,j):
    n=0
    liste=[False,False,False,False] #Nord-Est-Sud-Ouest dans l'ordre
    if m[i][j]==1:
        if m[i-1][j]!=0:#N
            liste[0]=True
        if m[i][j+1]!=0:#E
            liste[1]=True
        if m[i+1][j]!=0:#S
            liste[2]=True
        if m[i][j-1]!=0:#O
            liste[3]=True
    if liste==[False,True,True,True]: n=2
    elif liste==[True,False,True,True]: n=5
    elif liste==[True,True,False,True]: n=4
    elif liste==[True,True,True,False]: n=3
    elif liste==[True,False,False,True]: n=9
    elif liste==[False,False,True,True]: n=8
    elif liste==[False,True,True,False]: n=7
    elif liste==[True,True,False,False]: n=6
    elif liste==[True,True,True,True]: n=10
    elif liste==[True,False,True,False]: n=1
    elif liste==[False,True,False,True]: n=1
    return n



def laby_PC(p):
    m=generation_labyrinthe(p)
    rigole(m)
    amincir(m)
    parfaire(m)
    return m

