def voisins_non_vus(mat,i,j):
    L=[]
    if mat[i-1][j]==0:
        L.append((i-1,j))
    if mat[i][j+1]==0:
        L.append((i,j+1))
    if mat[i+1][j]==0:
        L.append((i+1,j))
    if mat[i][j-1]==0:
        L.append((i,j-1))
    return L

